INSERT INTO `boot_sys_operate_log` VALUES (1562447911444471810, 1341620898007281665, 1341620898007281665, '2022-08-24 22:33:06', '2022-08-24 22:33:06', 0, 1, 1535881356595175426, '0', 0, '音频修改', '音频管理', '/sys/resource/audio/api/update', 'io.laokou.admin.interfaces.controller.SysAudioApiController.update()', 'PUT', '[\n	{\n		\"code\":\"audio\",\n		\"id\":1441610450502848541,\n		\"remark\":\"七里香歌曲《七里香》，由周杰伦演唱，方文山作词，周杰伦谱曲，钟兴民编曲，收录在周杰伦2004年8月3日发行的同名专辑《七里香》中。\\n2004年，该曲获得香港TVB8十大金曲最佳作曲、监制、编曲3项大奖。2005年，该曲获得第27届十大中文金曲十大金曲奖、优秀流行华语歌曲奖以及第11届全球华语音乐榜中榜年度最佳歌曲等多个奖项。\",\n		\"tags\":\"周杰伦\",\n		\"title\":\"周杰伦 - 七里香.flac\",\n		\"uri\":\"http://175.178.69.253:81/upload/node1/31dbe74b6a184f94b3e690ddb23b173d.flac\"\n	}\n]', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/96.0.4664.93 Safari/537.36', '223.148.76.2', '中国 湖南省 株洲市 电信', 0, 'admin', NULL, 200);
