INSERT INTO `boot_sys_operate_log` VALUES (1562980618226298882, 1341620898007281665, 1341620898007281665, '2022-08-26 09:49:53', '2022-08-26 09:49:53', 0, 1, 1535881356595175426, '0', 0, '音频修改', '音频管理', '/sys/resource/audio/api/update', 'io.laokou.admin.interfaces.controller.SysAudioApiController.update()', 'PUT', '[\n	{\n		\"code\":\"audio\",\n		\"id\":1441610450502848544,\n		\"remark\":\"《夜的第七章》讲的是伦敦近郊的公园里的发生了一起凶杀案，现场唯一留下的线索是死者口里的一朵蓝色玫瑰的故事。\\n《夜的第七章》是周杰伦、潘儿演唱的一首歌曲，由黄俊郎作词，周杰伦作曲，钟兴民、林迈可编曲。收录在周杰伦于2006年9月5日发行的专辑《依然范特西》中。\",\n		\"tags\":\"周杰伦\",\n		\"title\":\"周杰伦 - 夜的第七章.mp3\",\n		\"uri\":\"http://175.178.69.253:81/upload/node2/23d90162fde44dd58b7e7147e196adb9.mp3\"\n	}\n]', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/96.0.4664.93 Safari/537.36', '116.128.233.192', '中国 湖南省 长沙市 联通', 0, 'admin', NULL, 200);
INSERT INTO `boot_sys_operate_log` VALUES (1562980990835683330, 1341620898007281665, 1341620898007281665, '2022-08-26 09:51:22', '2022-08-26 09:51:22', 0, 1, 1535881356595175426, '0', 0, '音频修改', '音频管理', '/sys/resource/audio/api/update', 'io.laokou.admin.interfaces.controller.SysAudioApiController.update()', 'PUT', '[\n	{\n		\"code\":\"audio\",\n		\"id\":1441610450502848533,\n		\"remark\":\"《稻香》是周杰伦演唱的一首歌曲，由周杰伦作词、作曲，黄雨勋编曲，收录在周杰伦2008年10月15日发行的专辑《魔杰座》中；周杰伦在接受媒体采访时表示，《稻香》是因5·12汶川地震创作的。\\n2009年这首歌曲获得第20届台湾金曲奖最佳年度歌曲奖、雪碧榜中国原创音乐流行榜港台地区歌曲奖等奖项。\",\n		\"tags\":\"周杰伦\",\n		\"title\":\"周杰伦 - 稻香.flac\",\n		\"uri\":\"http://175.178.69.253:81/upload/node4/76340fdb43be499ea3a540ea6f934267.flac\"\n	}\n]', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/96.0.4664.93 Safari/537.36', '116.128.233.192', '中国 湖南省 长沙市 联通', 0, 'admin', NULL, 200);
INSERT INTO `boot_sys_operate_log` VALUES (1562981198726361089, 1341620898007281665, 1341620898007281665, '2022-08-26 09:52:11', '2022-08-26 09:52:11', 0, 1, 1535881356595175426, '0', 0, '音频修改', '音频管理', '/sys/resource/audio/api/update', 'io.laokou.admin.interfaces.controller.SysAudioApiController.update()', 'PUT', '[\n	{\n		\"code\":\"audio\",\n		\"id\":1441610450502848543,\n		\"remark\":\"《烟花易冷》是方文山作词，黄雨勋编曲，周杰伦作曲并演唱的一首歌曲，收录在周杰伦2010年5月18日发行的专辑《跨时代》中。\\n2011年，该曲获得2010年度北京流行音乐典礼“年度金曲奖”。\",\n		\"tags\":\"周杰伦\",\n		\"title\":\"周杰伦 - 烟花易冷.flac\",\n		\"uri\":\"http://175.178.69.253:81/upload/node4/4c6655d7d5dc42b1a491f8a0c4138413.flac\"\n	}\n]', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/96.0.4664.93 Safari/537.36', '116.128.233.192', '中国 湖南省 长沙市 联通', 0, 'admin', NULL, 200);
INSERT INTO `boot_sys_operate_log` VALUES (1562981377152053250, 1341620898007281665, 1341620898007281665, '2022-08-26 09:52:54', '2022-08-26 09:52:54', 0, 1, 1535881356595175426, '0', 0, '音频修改', '音频管理', '/sys/resource/audio/api/update', 'io.laokou.admin.interfaces.controller.SysAudioApiController.update()', 'PUT', '[\n	{\n		\"code\":\"audio\",\n		\"id\":1441610450502848545,\n		\"remark\":\"《夜曲》是周杰伦演唱的一首歌曲，由方文山作词，周杰伦作曲，林迈可编曲，收录在周杰伦2005年11月1日发行的专辑《11月的萧邦》中。\\n2005年，该曲获得雪碧榜港台金曲、9+2音乐先锋榜年度先锋金曲。2006年，该曲获得全球华语音乐榜中榜年度最佳歌曲等多个奖项。\",\n		\"tags\":\"周杰伦\",\n		\"title\":\"周杰伦 - 夜曲.flac\",\n		\"uri\":\"http://175.178.69.253:81/upload/node1/eefa051169454bf9ab1ccaa313febf8e.flac\"\n	}\n]', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/96.0.4664.93 Safari/537.36', '116.128.233.192', '中国 湖南省 长沙市 联通', 0, 'admin', NULL, 200);
INSERT INTO `boot_sys_operate_log` VALUES (1562981541363249153, 1341620898007281665, 1341620898007281665, '2022-08-26 09:53:33', '2022-08-26 09:53:33', 0, 1, 1535881356595175426, '0', 0, '音频修改', '音频管理', '/sys/resource/audio/api/update', 'io.laokou.admin.interfaces.controller.SysAudioApiController.update()', 'PUT', '[\n	{\n		\"code\":\"audio\",\n		\"id\":1441610450502848539,\n		\"remark\":\"《龙卷风》是周杰伦演唱的一首歌曲，由徐若瑄作词，周杰伦作曲，钟兴民编曲，收录于周杰伦2000年11月7日发行的首张个人专辑《Jay》中。\\n2001年，该歌曲获得新城劲爆卡拉OK歌曲奖。\",\n		\"tags\":\"周杰伦\",\n		\"title\":\"周杰伦 - 龙卷风.flac\",\n		\"uri\":\"http://175.178.69.253:81/upload/node4/f74da90133ed48638193cc072773a217.flac\"\n	}\n]', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/96.0.4664.93 Safari/537.36', '116.128.233.192', '中国 湖南省 长沙市 联通', 0, 'admin', NULL, 200);
INSERT INTO `boot_sys_operate_log` VALUES (1562981678844145665, 1341620898007281665, 1341620898007281665, '2022-08-26 09:54:06', '2022-08-26 09:54:06', 0, 1, 1535881356595175426, '0', 0, '音频修改', '音频管理', '/sys/resource/audio/api/update', 'io.laokou.admin.interfaces.controller.SysAudioApiController.update()', 'PUT', '[\n	{\n		\"code\":\"audio\",\n		\"id\":1441610450502848537,\n		\"remark\":\"《霍元甲》是周杰伦演唱的一首歌曲，由方文山作词，周杰伦作曲，洪敬尧编曲，收录于2006年1月20日发行的同名EP《霍元甲》中。该曲是电影《霍元甲》的同名主题曲。\\n2007年，该曲获得第26届香港电影金像奖最佳原创电影歌曲提名，周杰伦凭借该曲获得第18届台湾金曲奖最佳单曲制作人奖。\",\n		\"tags\":\"周杰伦\",\n		\"title\":\"周杰伦 - 霍元甲.flac\",\n		\"uri\":\"http://175.178.69.253:81/upload/node3/e632ad8073b24f76a8ca17e6d9a812ae.flac\"\n	}\n]', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/96.0.4664.93 Safari/537.36', '116.128.233.192', '中国 湖南省 长沙市 联通', 0, 'admin', NULL, 200);
INSERT INTO `boot_sys_operate_log` VALUES (1562981830942191617, 1341620898007281665, 1341620898007281665, '2022-08-26 09:54:42', '2022-08-26 09:54:42', 0, 1, 1535881356595175426, '0', 0, '音频修改', '音频管理', '/sys/resource/audio/api/update', 'io.laokou.admin.interfaces.controller.SysAudioApiController.update()', 'PUT', '[\n	{\n		\"code\":\"audio\",\n		\"id\":1441610450502848535,\n		\"remark\":\"《断了的弦》是周杰伦演唱的一首歌曲，由方文山作词，周杰伦作曲，钟兴民编曲，收录于周杰伦于2003年11月13日发行的EP《寻找周杰伦》中 。该曲是电影《寻找周杰伦》的插曲。\",\n		\"tags\":\"周杰伦\",\n		\"title\":\"周杰伦 - 断了的弦.flac\",\n		\"uri\":\"http://175.178.69.253:81/upload/node5/b5c8a23a9aeb4fb7963a93b5a46d034c.flac\"\n	}\n]', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/96.0.4664.93 Safari/537.36', '116.128.233.192', '中国 湖南省 长沙市 联通', 0, 'admin', NULL, 200);
INSERT INTO `boot_sys_operate_log` VALUES (1562982029349548034, 1341620898007281665, 1341620898007281665, '2022-08-26 09:55:29', '2022-08-26 09:55:29', 0, 1, 1535881356595175426, '0', 0, '音频修改', '音频管理', '/sys/resource/audio/api/update', 'io.laokou.admin.interfaces.controller.SysAudioApiController.update()', 'PUT', '[\n	{\n		\"code\":\"audio\",\n		\"id\":1441610450502848534,\n		\"remark\":\"《东风破》是周杰伦演唱的一首歌曲，由周杰伦谱曲，方文山填词，林迈可编曲，收录在周杰伦2003年7月31日发行的个人第四张专辑《叶惠美》中。\\n2004年，该歌曲获得第四届华语流行乐传媒大奖十大单曲奖、第11届中国歌曲排行榜港台地区最受欢迎歌曲奖、MusicRadio中国TOP排行榜台港地区年度歌曲和第七届中央电视台音乐电视大赛港台及海外华语最佳MV作品奖等奖项，方文山凭借该歌曲获得第四届百事音乐风云榜年度港台及海外华人最佳作词奖。\",\n		\"tags\":\"周杰伦\",\n		\"title\":\"周杰伦 - 东风破.flac\",\n		\"uri\":\"http://175.178.69.253:81/upload/node3/a56c134452cc466e8596c39d9c4fb0bc.flac\"\n	}\n]', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/96.0.4664.93 Safari/537.36', '116.128.233.192', '中国 湖南省 长沙市 联通', 0, 'admin', NULL, 200);
INSERT INTO `boot_sys_operate_log` VALUES (1562982185260216322, 1341620898007281665, 1341620898007281665, '2022-08-26 09:56:06', '2022-08-26 09:56:06', 0, 1, 1535881356595175426, '0', 0, '音频修改', '音频管理', '/sys/resource/audio/api/update', 'io.laokou.admin.interfaces.controller.SysAudioApiController.update()', 'PUT', '[\n	{\n		\"code\":\"audio\",\n		\"id\":1441610450502848530,\n		\"remark\":\"《布拉格广场》是蔡依林、周杰伦演唱的歌曲，由方文山作词、周杰伦作曲、钟兴民编曲，收录于蔡依林2003年3月7日发行的专辑《看我72变》中。\\n2004年5月，钟兴民在第15届台湾金曲奖颁奖典礼上凭借该曲获得“最佳编曲人奖” 。\",\n		\"tags\":\"蔡依林,周杰伦\",\n		\"title\":\"蔡依林_周杰伦 - 布拉格广场.flac\",\n		\"uri\":\"http://175.178.69.253:81/upload/node5/a607608ec20b46e2abbeaf3e704db6d6.flac\"\n	}\n]', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/96.0.4664.93 Safari/537.36', '116.128.233.192', '中国 湖南省 长沙市 联通', 0, 'admin', NULL, 200);
INSERT INTO `boot_sys_operate_log` VALUES (1562982360611483649, 1341620898007281665, 1341620898007281665, '2022-08-26 09:56:48', '2022-08-26 09:56:48', 0, 1, 1535881356595175426, '0', 0, '音频修改', '音频管理', '/sys/resource/audio/api/update', 'io.laokou.admin.interfaces.controller.SysAudioApiController.update()', 'PUT', '[\n	{\n		\"code\":\"audio\",\n		\"id\":1441610450502848542,\n		\"remark\":\"《千里之外》是周杰伦、费玉清演唱的一首歌曲，由方文山作词，周杰伦作曲，林迈可编曲，收录在周杰伦2006年9月5日发行的专辑《依然范特西》中，是周杰伦的代表作品之一。该歌曲另有费玉清的独唱版本，收录于费玉清2007年4月20日发行的专辑《回想曲青青校树》中。\\n2007年，该歌曲获得了第十三届全球华语音乐榜中榜年度最佳歌曲奖、第29届十大中文金曲全国最受欢迎中文歌曲奖、第7届蒙牛酸酸乳音乐风云榜年度最佳歌曲奖。\",\n		\"tags\":\"费玉清,周杰伦\",\n		\"title\":\"周杰伦_费玉清 - 千里之外.flac\",\n		\"uri\":\"http://175.178.69.253:81/upload/node4/7c51289e75fd427484871b63aeee0545.flac\"\n	}\n]', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/96.0.4664.93 Safari/537.36', '116.128.233.192', '中国 湖南省 长沙市 联通', 0, 'admin', NULL, 200);
