INSERT INTO `boot_sys_operate_log` VALUES (1562983488128479233, 1341620898007281665, 1341620898007281665, '2022-08-26 10:01:17', '2022-08-26 10:01:17', 0, 1, 1535881356595175426, '0', 0, '音频修改', '音频管理', '/sys/resource/audio/api/update', 'io.laokou.admin.interfaces.controller.SysAudioApiController.update()', 'PUT', '[\n	{\n		\"code\":\"audio\",\n		\"id\":1441610450502848520,\n		\"remark\":\"《你笑起来真好看》是由周兵作词，李凯稠作曲，李昕融、樊桐舟、李凯稠共同演唱的歌曲，于2020年10月26日以单曲形式发行。\\n2020年，该曲获得中国当代歌曲创作精品工程“听见中国听见你”年度优秀歌曲奖。\",\n		\"tags\":\"李昕融,樊桐舟,李凯稠\",\n		\"title\":\"李昕融_樊桐舟_李凯稠 - 你笑起来真好看.mp3\",\n		\"uri\":\"http://175.178.69.253:81/upload/node1/6f159e4ade6340cfa877508f28457289.mp3\"\n	}\n]', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/96.0.4664.93 Safari/537.36', '116.128.233.192', '中国 湖南省 长沙市 联通', 0, 'admin', NULL, 200);
INSERT INTO `boot_sys_operate_log` VALUES (1562983676033298434, 1341620898007281665, 1341620898007281665, '2022-08-26 10:02:02', '2022-08-26 10:02:02', 0, 1, 1535881356595175426, '0', 0, '音频修改', '音频管理', '/sys/resource/audio/api/update', 'io.laokou.admin.interfaces.controller.SysAudioApiController.update()', 'PUT', '[\n	{\n		\"code\":\"audio\",\n		\"id\":1441610450502848516,\n		\"remark\":\"《无赖》是郑中基演唱的一首粤语歌曲，由李峻一填词、作曲，收录在郑中基2005年6月由金牌大风唱片发行的粤语专辑《Before After》中。该歌曲是电影《龙咁威2之皇母娘娘呢》的主题曲。\\n2005年12月该歌曲获得新城劲爆歌曲、劲爆卡拉OK歌曲两个奖项；2006年获得第28届香港十大中文金曲、2005年度十大劲歌金曲金曲奖。\",\n		\"tags\":\"郑中基\",\n		\"title\":\"郑中基 - 无赖.mp3\",\n		\"uri\":\"http://175.178.69.253:81/upload/node2/0cacaed1d0e24dd8bf783d6126981cd3.mp3\"\n	}\n]', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/96.0.4664.93 Safari/537.36', '116.128.233.192', '中国 湖南省 长沙市 联通', 0, 'admin', NULL, 200);
