INSERT INTO `boot_sys_operate_log` VALUES (1562984827227140097, 1341620898007281665, 1341620898007281665, '2022-08-26 10:06:36', '2022-08-26 10:06:36', 0, 1, 1535881356595175426, '0', 0, '音频修改', '音频管理', '/sys/resource/audio/api/update', 'io.laokou.admin.interfaces.controller.SysAudioApiController.update()', 'PUT', '[\n	{\n		\"code\":\"audio\",\n		\"id\":1429358833586081793,\n		\"remark\":\"《日不落》是中国台湾流行音乐女歌手蔡依林演唱的一首歌曲，翻唱自BWO的《Sunshine in the Rain》，由崔惟楷重新填词，Bodies Without Organs作曲，收录于蔡依林2007年09月21日发行的专辑《特务J》中，亦是音乐电影《记忆的裂痕》中的背景音乐。\\n该歌曲发行后获得第六届HITO流行音乐奖年度听众最爱歌曲、第十五届北京流行音乐典礼年度金曲和第八届全球华语歌曲排行榜最受欢迎二十大金曲等奖项。2008年1月《日不落》获得中国台湾Hit Fm百首单曲冠军。\",\n		\"tags\":\"蔡依林\",\n		\"title\":\"蔡依林 - 日不落.mp3\",\n		\"uri\":\"http://175.178.69.253:81/upload/node3/bea227b2276e4ff08ba80c78bb135c28.mp3\"\n	}\n]', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/96.0.4664.93 Safari/537.36', '116.128.233.192', '中国 湖南省 长沙市 联通', 0, 'admin', NULL, 200);
