INSERT INTO `boot_sys_operate_log` VALUES (1562987198825033729, 1341620898007281665, 1341620898007281665, '2022-08-26 10:16:02', '2022-08-26 10:16:02', 0, 1, 1535881356595175426, '0', 0, '音频修改', '音频管理', '/sys/resource/audio/api/update', 'io.laokou.admin.interfaces.controller.SysAudioApiController.update()', 'PUT', '[\n	{\n		\"code\":\"audio\",\n		\"id\":1429358962762256386,\n		\"remark\":\"《红昭愿》是来自音阙诗听音乐社的一首原创作品，由荒唐客作词，殇小瑾作曲，流茫菌演唱的一首歌。正式发行于2017年1月11日。大量的不重复处理让歌曲呈现更高的耐听感，时时刻刻都是新鲜的元素！据社长也亦是《红昭愿》这首歌的制作人殇小谨介绍：“魔性的开场loop人声采样，是我们的第七版创意。和声的配唱模式，是我们的第三版创意。编曲的整体搭配，包括中国风古筝元素的加入，是我们的第三版创意。”\",\n		\"tags\":\"流芒菌\",\n		\"title\":\"流芒菌 - 红昭愿.mp3\",\n		\"uri\":\"http://175.178.69.253:81/upload/node4/fa9aa526d024481b9c1c5cbdc5ae2ab0.mp3\"\n	}\n]', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/96.0.4664.93 Safari/537.36', '116.128.233.192', '中国 湖南省 长沙市 联通', 0, 'admin', NULL, 200);
INSERT INTO `boot_sys_operate_log` VALUES (1562987341729165314, 1341620898007281665, 1341620898007281665, '2022-08-26 10:16:36', '2022-08-26 10:16:36', 0, 1, 1535881356595175426, '0', 0, '音频修改', '音频管理', '/sys/resource/audio/api/update', 'io.laokou.admin.interfaces.controller.SysAudioApiController.update()', 'PUT', '[\n	{\n		\"code\":\"audio\",\n		\"id\":1429359285337788418,\n		\"remark\":\"《淋雨一直走》是张韶涵演唱的一首歌曲，收录在张韶涵发行的专辑《有形的翅膀》中。\\n2012年12月这首歌曲获得第20届中国歌曲排行榜年度金曲奖和最佳编曲奖，2013年4月获得Music Radio中国TOP排行榜年度金曲奖。\",\n		\"tags\":\"张韶涵\",\n		\"title\":\"张韶涵 - 淋雨一直走.mp3\",\n		\"uri\":\"http://175.178.69.253:81/upload/node2/fc4f4b3713174e57a9e88cc55e9d009f.mp3\"\n	}\n]', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/96.0.4664.93 Safari/537.36', '116.128.233.192', '中国 湖南省 长沙市 联通', 0, 'admin', NULL, 200);
