INSERT INTO `boot_sys_operate_log` VALUES (1562988005792346114, 1341620898007281665, 1341620898007281665, '2022-08-26 10:19:14', '2022-08-26 10:19:14', 0, 1, 1535881356595175426, '0', 0, '视频修改', '视频管理', '/sys/resource/video/api/update', 'io.laokou.admin.interfaces.controller.SysVideoApiController.update()', 'PUT', '[\n	{\n		\"code\":\"video\",\n		\"id\":1441610450502848514,\n		\"remark\":\"《沧海一声笑》是1990年上映的电影《笑傲江湖》的主题曲，由黄霑作词、作曲，顾嘉辉编曲。\\n歌曲分粤语、普通话两个版本，但歌词几乎相同；粤语版由许冠杰演唱，收录于许冠杰1990年4月1日由宝丽金唱片发行的专辑《\'90电影金曲精选》中；普通话版由罗大佑、黄霑、徐克共同演唱，收录于黄沾1990年由滚石唱片发行的专辑《笑傲江湖-百无禁忌黄沾作品集》中。\\n1991年，该曲获第10届香港电影金像奖最佳原创电影歌曲奖。\",\n		\"tags\":\"黄霑,罗大佑,徐克\",\n		\"title\":\"黄霑_罗大佑_徐克 - 沧海一声笑.mp4\",\n		\"uri\":\"http://175.178.69.253:81/upload/node4/108f3fe556a54faea00c0af69ff7a832.mp4\"\n	}\n]', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/96.0.4664.93 Safari/537.36', '116.128.233.192', '中国 湖南省 长沙市 联通', 0, 'admin', NULL, 200);
