INSERT INTO `boot_sys_operate_log` VALUES (1585127929001742337, 1341620898007281665, 1341620898007281665, '2022-10-26 12:35:23', '2022-10-26 12:35:23', 0, 1, 1535881356595175426, '0', 0, '视频新增', '视频管理', '/sys/resource/video/api/insert', 'io.laokou.admin.interfaces.controller.SysVideoApiController.insert()', 'POST', '[ {\n  \"id\" : null,\n  \"title\" : \"任贤齐 - 天涯.mp4\",\n  \"uri\" : \"http://175.178.69.253:81/upload/node1/bfeb8d47dc754fa884e1678bc3a980f9.mp4\",\n  \"code\" : \"video\",\n  \"remark\" : \"《天涯》是任贤齐翻唱中岛美雪竹の歌，由陈没填词，蔡朝华编曲，收录在任贤齐2000年1月27日由滚石唱片发行的专辑《为爱走天涯》中。该歌曲是2000年台湾中视电视剧《笑傲江湖》的片尾曲。\",\n  \"tags\" : \"天涯,任贤齐\",\n  \"md5\" : \"f22f02d61ad8d437e36359a394dc1424\"\n} ]', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/108.0.0.0 Safari/537.36', '219.133.165.18', '中国 广东省 深圳市 电信', 0, 'admin', NULL, 200);
