INSERT INTO `boot_sys_operate_log` VALUES (1585128822229110785, 1341620898007281665, 1341620898007281665, '2022-10-26 12:38:56', '2022-10-26 12:38:56', 0, 1, 1535881356595175426, '0', 0, '视频新增', '视频管理', '/sys/resource/video/api/insert', 'io.laokou.admin.interfaces.controller.SysVideoApiController.insert()', 'POST', '[ {\n  \"id\" : null,\n  \"title\" : \"任贤齐 - 心太软.mp4\",\n  \"uri\" : \"http://175.178.69.253:81/upload/node1/44fba7e03c9c4f6da79a7152e56f5e64.mp4\",\n  \"code\" : \"video\",\n  \"remark\" : \"《心太软》是任贤齐1996年12月24日发行的一张专辑，由小虫担任制作人，滚石唱片发行，共收录10首歌曲。\\n该专辑的同名主打歌《心太软》荣获香港电台十大劲爆国语金曲铜奖、香港新城精选104电台国语金奖、1997ChannelV华语榜中榜TOP20第二名。\",\n  \"tags\" : \"任贤齐,心太软\",\n  \"md5\" : \"8965c0b9bd04bdca71b931e4632959bb\"\n} ]', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/108.0.0.0 Safari/537.36', '219.133.165.18', '中国 广东省 深圳市 电信', 0, 'admin', NULL, 200);
INSERT INTO `boot_sys_operate_log` VALUES (1585129643960373250, 1341620898007281665, 1341620898007281665, '2022-10-26 12:42:12', '2022-10-26 12:42:12', 0, 1, 1535881356595175426, '0', 0, '视频新增', '视频管理', '/sys/resource/video/api/insert', 'io.laokou.admin.interfaces.controller.SysVideoApiController.insert()', 'POST', '[ {\n  \"id\" : null,\n  \"title\" : \"杨千嬅_任贤齐 - 花好月圆夜 (国语版).mp4\",\n  \"uri\" : \"http://175.178.69.253:81/upload/node1/d41be2c462a84cbdb6bb40182c4e7196.mp4\",\n  \"code\" : \"video\",\n  \"remark\" : \"《花好月圆夜》是由任贤齐、杨千嬅演唱的一首歌曲，由任贤齐作曲，伍乐城编曲，分普通话、粤语两个版本，普通话版由任贤齐作词，粤语版由林夕作词，两版皆收录在杨千嬅2004年1月21日发行的EP《2004开大》中 [2-3]  。该曲是电影《花好月圆》的插曲。\",\n  \"tags\" : \"花好月圆,杨千嬅,任贤齐\",\n  \"md5\" : \"e034a496f28b3206ab0d2f2d3a6e4c26\"\n} ]', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/108.0.0.0 Safari/537.36', '219.133.165.18', '中国 广东省 深圳市 电信', 0, 'admin', NULL, 200);
INSERT INTO `boot_sys_operate_log` VALUES (1585130308694642689, 1341620898007281665, 1341620898007281665, '2022-10-26 12:44:51', '2022-10-26 12:44:51', 0, 1, 1535881356595175426, '0', 0, '音频新增', '音频管理', '/sys/resource/audio/api/insert', 'io.laokou.admin.interfaces.controller.SysAudioApiController.insert()', 'POST', '[ {\n  \"id\" : null,\n  \"title\" : \"范倪Liu - 南半球与北海道.mp3\",\n  \"uri\" : \"http://175.178.69.253:81/upload/node5/7931e662df164b0281752a26be9a74e3.mp3\",\n  \"code\" : \"audio\",\n  \"remark\" : \"“我告别南半球奔向北海道，愿化作那昼夜的飞鸟将你拥抱”\\n    尘埃力量携手旗下女歌手范倪Liu带来全新单曲《南半球与北海道》。范倪Liu治愈演绎，你的笑盛放于花海，那是我见过最美的画面。我告别南半球与北海道，与零度经线的距离只差分毫，只能目送你随日落消失于眼角。我多想能穿梭到平行时空，乘着风，奔向你...\",\n  \"tags\" : \"范倪Liu,南半球与北海道\",\n  \"md5\" : \"9e5739f0106851f405da618a6aba508a\"\n} ]', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/108.0.0.0 Safari/537.36', '219.133.165.18', '中国 广东省 深圳市 电信', 0, 'admin', NULL, 200);
